import React from 'react';
import './LoginPage.css';

function LoginPage() {
  return (
    <div className="login-container">
      <img className='login-girlSearching' src="./Images/girl-searching.svg" alt="Imagem" />

      <div className='login-containerWithFields'>
        <h1>Entrar na Seculus Web</h1>
        <h2 class="split-title">
      <span class="left-half">Metade Esquerda</span>
      <span class="right-half clickable">Metade Clicável</span>
    </h2>
        <h2>Novo usuário? Criar uma conta</h2>
      </div>
    </div>
  );
}

export default LoginPage;
